import React, { useEffect, useRef } from "react";
import { makeStyles } from "@material-ui/core";
// import ManageNavbar from "../../src/components/header";
// import "react-responsive-carousel/lib/styles/carousel.min.css";
// import { Carousel } from 'react-responsive-carousel';
import Typography from "@material-ui/core/Typography";
// import Slider from "react-slick";
// import NavigateNextIcon from "@material-ui/icons/NavigateNext";
// import NavigateBeforeIcon from "@material-ui/icons/NavigateBefore";
// import image from "../../public/assets/slide.png";
import searchsitemap from "../../../public/assets/searchsitemap.png";
export default function SearchSiteMap(props) {
  const classes = useStyles();
  const ref = useRef({});
  return (
    <div className={classes.root}>
      <div className={classes.titleWraper}>
        <Typography className={classes.title}> TÍNH NĂNG NỔI BẬT</Typography>
        <Typography variant="h5"> ĐIỂM NỔI BẬT</Typography>
      </div>
      <div className={classes.sitemap}>
        <div className={classes.sitemapsearch}>
          <Typography className={classes.title}> TÍNH NĂNG NỔI BẬT</Typography>
          <Typography variant="h5"> ĐIỂM NỔI BẬT</Typography>
        </div>
        <div className={classes.violation}>
          <img src={searchsitemap}></img>
        </div>
      </div>
      <div className={classes.sitemap}>
        <div className={classes.sitemapsearch}></div>
        <div className={classes.violation}></div>
      </div>
    </div>
  );
}
const useStyles = makeStyles((theme) => ({
  root: {},
  titleWraper: {
    textAlign: "center",
  },
  title: {
    color: "#0055A7",
  },
}));
